# 2019/12/1
class Solution:
	def countSquares(self, matrix) -> int:
		maxSide=min(len(matrix), len(matrix[0]))
		ans=0
		def checkAllOne(i,j,s):
			for k in range(i,i+s):
				for l in range(j,j+s):
					if matrix[k][l]!=1:
						return False, k
			return True, 0
		for s in range(1,maxSide+1):
			i,j=0,0
			# print(s)
			while i+s<=len(matrix):
				while j+s<=len(matrix[0]):
					res = checkAllOne(i,j,s)
					if res[0]:
						ans+=1
					else:
						i+=res[1]
						if i+s>len(matrix):
							break
					j+=1
				i+=1
				j=0
			# print(ans)
		return ans

